VALUES ('20929268', 'Timbale de marrins et girolles cuisinés', '53,4* matmn, girolle, champignons de Paris (champignon, eau, sel, acidifiant : acide citrique ; antio»eène : acide ascorbique), crème (crème de lait, stabilisant : cattaghénanes) (origine : France), huile de tournesol, beurre (lait) (origine : UE), sei itn de Noirmoutier, persil. Traces de céleri, de fruits à coque, de soja et de céréales contenant du gluten. Conseils de dégustation : Au bain-marie : ôter le fourreau puis placer la barquette dans une casserole remplie d\'eau frémissante mais non bouillante. Laisser réchauffer pendant 15 minutes environ. Retirer la barquette du bain-marie et ôter le film. Démouler sur assiette. Au micro-ondes : ôter le fourreau et décoller légèrement le film de la barquette dans un coin. Placer la barquette au micro-ondes pendant 2 minutes à 750W. Ôter le film de la barquette. Démouler sur assiette. Temps à adapter selon la puissance de votre micro-ondes. Après réchauffage, mélanger le produit avant de le déguster. À conserver entre OOC et + 40C.', 'https://static.openfoodfacts.org/images/products/20929268/front_fr.4.400.jpg', '4.4', '1.6', '27.2', '4.3', '5.2', '2.4', '0.83', '0.326771653543307', '', '1');

