INSERT INTO product (barcode_id, product_name, ingredients, product_image, fat_amount, saturated_fats, carbohydrate, sugar, dietary_fiber, protein, salt, sodium, alcohol, is_healthy)
VALUES ('20939229', 'Fondue suisse', '52% fromage (lait), 32% vin blanc (sulfite), eau, amid de pomme de terre, 1,3% Kirsch, sel, sels de fonte: phosphates de sodium; plantes aromatiques, stabilisant: farine graines de caroube. À conserver à l\'abri de la chaleur et de l\'humidité. Non ouvert, à consommer de préférence avant voir sur le côté. Après ouverture, à conserver au réfrigérateur à +7 oc. max. et à consommer rapidement. Conseil préparaüon: 1. Verser le contenu de l\'emballage dans un caquelon et le réchauffer à feu vif sans cesser de remuer. Assaisonner selon ses préférences avec du poivre, de la noix de muscade ou de l\'ail. 3. Poser le caquelon sur réchaud à fondue ou une plaque électrique et laisser cuire pendant le repas. Conseil de dégustation: Piquer morceau de pain sur une fouchette, tremper dans le fromage et déguster?', 'https://static.openfoodfacts.org/images/products/20939229/front_fr.9.400.jpg', '15', '9.1', '2.9', '0.1', '', '15.5', '1.6', '0.62992125984252', '', '0');

